import './App.css';

function App() {
  return (
    <div className="App">
        TodoItem()
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edita el archivo <code>src/App.js</code> y guarda para recargar.
        </p>
        <a
          className="App-link"
          href="https://platzi.com/reactjs"
          target="_blank"
          rel="noopener noreferrer"
        >
          Aprende React
        </a>
      </header>
    </div>
  );
}

function TodoItem(){
  return(
  <li>
    <span>V</span>
    <p>Cry with cry-baby</p>
    <span>X</span>
  </li>
  );
}

export default App;
